import { Container, Row, Col, Card, Button, useState } from "react-bootstrap";
import "../Projects/Projects.css";
import FillerImg from "../Images/filler.jpg";

export const Projects = () => {
  const [ishover, sethover] = useState(false);

  function MouseOver() {
    sethover(true);
  }
  function MouseOut() {
    sethover(false);
  }
  return (
    <Container fluid>
      <Row>
        <Col sm={12} md={4}>
          <Card>
            <Card.Img
              onMouseOver={MouseOver}
              onMouseOut={MouseOut}
              onClick={handleClick}
              variant="top"
              src={FillerImg}
            />
            <Card.Body>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
              <Button class="btn rounded" href="#">
                Read More
              </Button>
            </Card.Body>
          </Card>
        </Col>
        <Col sm={12} md={4}>
          <Card>
            <Card.Img
              onMouseOver={MouseOver}
              onMouseOut={MouseOut}
              onClick={handleClick}
              variant="top"
              src={FillerImg}
            />
            <Card.Body>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
              <Button class="btn rounded" href="#">
                Read More
              </Button>
            </Card.Body>
          </Card>
        </Col>
        <Col sm={12} md={4}>
          <Card>
            <Card.Img
              onMouseOver={MouseOver}
              onMouseOut={MouseOut}
              onClick={handleClick}
              style={{ backgroundColor: ishover ? "black" : null }}
              variant="top"
              src={FillerImg}
            />
            <Card.Body>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
              <Button class="btn rounded" href="#">
                Read More
              </Button>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Projects;
